import styled from 'styled-components'


export default styled.div`
grid-area: CC;
display: flex;
flex-direction: column;

/* background-color: var(--primary); */

  li{
    list-style: none;
    p{
    /* flex-direction: row; */
    display: inline-block;
    }
  }




div#messages{
  height: 77%;
  overflow-y: scroll;
  ::-webkit-scrollbar { /* Sem Barra de rolagem */
    display: none;
  }
}

div#contats{
  max-height:250px;
  overflow-y: scroll;
  ::-webkit-scrollbar { /* Sem Barra de rolagem */
    display: none;
  }
}

.author{
  color: red;
}
.destiny{
  color: green;
}
.content{
  color: grey;
}
`
